let SysTray = require('systray').default
let { Client } = require("vlc-client");
let {clearPresence, updatePresence, setPresence} = require('./rpc')
let vlc = new Client({
    ip: 'localhost',
    port: 8080,
    username: '',
    password: 'password'
})

const path = require("path");
const PKG_TOP_DIR = 'snapshot';

const runInPKG = (function(){
    const pathParsed = path.parse(__dirname);
    const root = pathParsed.root;
    const dir = pathParsed.dir;
    const firstDepth = path.relative(root, dir).split(path.sep)[0];
    return (firstDepth === PKG_TOP_DIR)
})();

configPath = process.cwd() + '/config.json';

if(runInPKG) {
    const deployPath = path.dirname(process.execPath);
    vlc.config = require(process.cwd() + '/config.json');
    configPath = path.join(deployPath, 'config.json');
}

vlc.config = require(configPath)

vlc.config.alternativeAlbumView = false
vlc.config.displayTrackNumber = false

const systray = new SysTray({
    menu: {
        icon: "",
        tooltip: "VLC Rich Presence",
        items: [{
            title: "Alternative Album Display",
            tooltip: "Displays the album info in an alternative style",
            checked: false,
            enabled: true
        }, {
            title: "Track Numbers",
            tooltip: "Displays the track numbers",
            checked: false,
            enabled: true
        }, {
            title: "Exit",
            tooltip: "bb",
            checked: false,
            enabled: true
        }]
    },
    debug: false,
    copyDir: true, // copy go tray binary to outside directory, useful for packing tool like pkg.
})

systray.onClick(action => {
    if (action.seq_id === 0) {
        vlc.config.alternativeAlbumView = !vlc.config.alternativeAlbumView
        systray.sendAction({
            type: 'update-item',
            item: {
                ...action.item,
                checked: !action.item.checked,
            },
            seq_id: action.seq_id,
        })
    } else if (action.seq_id === 1) {
        vlc.config.displayTrackNumber = !vlc.config.displayTrackNumber
        systray.sendAction({
            type: 'update-item',
            item: {
                ...action.item,
                checked: !action.item.checked,
            },
            seq_id: action.seq_id,
        })
    } else if (action.seq_id === 2) {
        systray.kill()
    }
})

setInterval(test, 5e3)

async function test() {
    try {
        if(!(await vlc.isPlaying()) && !(await vlc.isPaused())){
            await clearPresence()
        }
        else{
            let presence = await updatePresence(vlc)
            await setPresence(presence)
        }
    } catch (e) {
        await clearPresence()
    }
}
